class Solution 
{ 
    void non_repeating(int N, int A[]) 
    { 
       Set<Integer> s=new LinkedHashSet<>();
       for(int i=0;i<N;i++)
       {
           s.add(A[i]);
       }
       for(int i:s)
       {
           System.out.print(i+" ");
       }
    }

